import { StyleSheet, Text, View } from 'react-native'

const styles = StyleSheet.create({
    head:{
        flexDirection:'row',
        alignItems:'center',
        padding:15,
        backgroundColor: "#abdcf5",
        marginBottom:3
    },
    text:{
        fontSize:20,
        marginLeft:10,
        fontWeight:'bold',
        color:"#127cc0"
    },
    
})

export default styles;
